/** @format */

import React from 'react';
import profile from '../images/profile.png';
import '../App.css';
import { CVDesc, CVApproach } from './TextInfo';

const CV = () => {
	return (
		<div className='container_CV'>
			<h1 className='title'>Executive Chef Yannick</h1>
			<span className='cv_info'>
				<span className='desc'>
					<img className='profile_pic' src={profile} alt='Yannick' />
					<span className='desc_text'>
						{CVDesc.map((item, index) => {
							return <p>{item}</p>;
						})}
					</span>
				</span>
				<span className='approach'>
					<h1 className='subtitle'>Working Approach</h1>
					<ul className='work_li'>
						{CVApproach.map((item, index) => {
							return <li>{item}</li>;
						})}
					</ul>
				</span>
			</span>
		</div>
	);
};

export default CV;
